import React, { useState, useEffect } from "react";

export default function Videos({ videos }) {
  return (
    <div>
      <ul className="video-list">
        {videos &&
          videos.map((v) => {
            return (
              <li>
                <video width="300" controls>
                  <source src={v.uri} type="video/mp4"></source>
                </video>
              </li>
            );
          })}
      </ul>
    </div>
  );
}
